use super::{find_char_index::FindCharIndex, to_vec::ToVec};

#[derive(Clone, Debug)]
pub struct TimeYiJi {
  elems: Option<Vec<TimeYiJiElem>>,
}

#[derive(Clone, Debug)]
pub struct TimeYiJiElem {
  pub day_time_hash: String,
  pub yi_hexs: Vec<String>,
  pub ji_hexs: Vec<String>,
}

impl Default for TimeYiJi {
  fn default() -> Self {
    Self { elems: None }
  }
}

impl TimeYiJi {
  pub fn debug_print(&mut self) {
    if self.elems.is_none() {
      self.setup();
    }

    println!("{:?}", self.elems);
  }

  fn setup(&mut self) -> Self {
    let __compacted = COMPACTED.to_string();
    let __compacted_char_len = __compacted.chars().count();
    let mut delim = __compacted.find_char_index("=");
    let mut elems = vec![];
    while delim.is_some() {
      let start = delim.unwrap() - 4;
      let end = delim.unwrap();
      let day_time_hash = __compacted.slice_by_char_idx(start, end);

      let start = end + 1;
      let end = __compacted.find_char_index_offset(start, ",").unwrap();
      let yi_hexs =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      let start = end + 1;
      let end = __compacted
        .find_char_index_offset(start, "=")
        .map_or(__compacted_char_len, |v| v - 4);
      let ji_hexs =
        __compacted.slice_by_char_idx(start, end).to_vec_hex_str();

      elems.push(TimeYiJiElem {
        day_time_hash,
        yi_hexs,
        ji_hexs,
      });

      delim = match end == __compacted_char_len {
        true => None,
        _ => Some(end + 4),
      }
    }

    self.elems = Some(elems);
    self.clone()
  }

  pub fn collect_yi_hexs(
    &self,
    day_hex: &str,
    time_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.clone().setup();
    };

    let day_time_hash = format!("{day_hex}{time_hex}");

    let found = self
      .elems
      .clone()
      .unwrap()
      .iter()
      .filter(|elem| elem.day_time_hash == day_time_hash)
      .map(|elem| elem.yi_hexs.clone())
      .flatten()
      .collect::<Vec<_>>();

    found
  }

  pub fn collect_ji_hexs(
    &self,
    day_hex: &str,
    time_hex: &str,
  ) -> Vec<String> {
    if self.elems.is_none() {
      self.clone().setup();
    };

    let day_time_hash = format!("{day_hex}{time_hex}");

    let found = self
      .elems
      .clone()
      .unwrap()
      .iter()
      .filter(|elem| elem.day_time_hash == day_time_hash)
      .map(|elem| elem.ji_hexs.clone())
      .flatten()
      .collect::<Vec<_>>();

    found
  }
}

